// import React, {useEffect,useState} from 'react'
// import {Link,  Route} from 'wouter'
import logo from './logo.svg'
import './App.css'

const endPoint = process.env.REACT_APP_API_URI || 'http://localhost:3001'

const fetchData = async () => {
  try {
    const response = await fetch(endPoint + '/keywords', {
      method: 'POST',
      headers: { 
        'Content-Type': 'application/json'
       },
      body: JSON.stringify({ 
        text: window.document.getElementById('text').value
      }) 
    });

    console.log(window.document.getElementById('text').value)
    // console.log(response)
    const data = await response.json();
    // console.log(data)
    console.log(data.keywords)
    window.document.getElementById('keywords').textContent = ''
    for (var key in data.keywords) {
      // console.log(data.keywords[key])
      window.document.getElementById('keywords').innerHTML += data.keywords[key] + '<br>'
    }
    // window.document.getElementById('keywords').value = data.keywords
  } catch (error) {
    console.log(error);
  }
};

export default function App() {
  // const [lists, setList] = useState(list1)

  // useEffect(function () {
